import React from 'react';

const Contact = ({ setCurrentPage }) => {
    const handleLinkClick = (page) => {
      setCurrentPage(page);
    };
  return (
    <header>
      <div style={headerStyle}>
      <h1>Contact</h1>
      <nav>
        <ul>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('home')}
            >
              Home
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('about')}
            >
              About
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('projects')}
            >
              Projects
            </button>
          </li>
          <li>
            <button
              style={buttonStyle}
              onClick={() => handleLinkClick('contact')}
            >
              Contact
            </button>
          </li>
        </ul>
      </nav>
      </div>
      <div style={imageContainerStyle}>
        <a href="mailto:alexbaptista19@gmail.com">
          <img src={require('./images/email.png')} alt="email" style={imageStyle}></img>
        </a>
        <a href="https://www.linkedin.com/in/alexander-baptista-09756316b/">
          <img src={require('./images/linkedin.png')} alt="LinkedIn" style={imageStyle}></img>
        </a>
      </div>

    </header>
  );
};



const imageStyle = {
  width: '100%',
  height: '100%',
  objectFit: 'cover',
};

const imageContainerStyle = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  padding: '100px'
};

const headerStyle = {
  backgroundColor: '#222',
  padding: '20px'
};

const buttonContainerStyle = {
  display: 'flex',
  listStyle: 'none',
  padding: '0',
  
};
export default Contact;
